import React from 'react'

const UserEmail = ({user}) => {

    function containsNumbers(str) {
        return /[0-9]/.test(str);
    }

  var car = user.car
  var email = user.email


  return (
    <div>
          {
              (car === "BMW" || car === "Mercedes-Benz" || car === "Audi") && (!containsNumbers(email))
      }
    </div>
  )
}

export default UserEmail
